public static BlockKey[] convertBlockKeys(List<BlockKeyProto> list) {
  BlockKey[] ret = new BlockKey[list.size()];
  int i = 0;
  for (BlockKeyProto k : list) {
    ret[i++] = convert(k);
  }
  return ret;
}
